e: 18px;\\\">Svaki sajt <i><span style=\\\"text-decoration: underline;\\\">MORA<\\/span> <\\/i>da poseduje hosting i domen koji se pla\\u0107aju, a njihova cena varira u odnosu na koliki vremenski period \\u017eelite da ih obnavljate, u dogovoru sa vama biramo ono \\u0161to Vama najvi\\u0161e odgovara.<\\/span><br \\/>Ukoliko \\u017eelite google analytics u okviru junior paketa to se napla\\u0107uje dodatnih\\u00a0 15 \\u20ac<br \\/>Sat vremena vanrednog rada\\u00a0 5 \\u20ac<br \\/><span style=\\\"font-size: 18px;\\\">Za svaku dodatnu stranicu napla\\u0107ujemo 7 \\u20ac<br \\/><\\/span><span style=\\\"font-size: 18px;\\\">Za svaku dodatnu <\\/span><span style=\\\"font-size: 18px;\\\">galeriju slika napla\\u0107ujemo 7 \\u20ac (do 20 slika)<br \\/>Odr\\u017eavanje na polugodi\\u0161njem nivou (a\\u017euriranje sajta i raznih plugina)\\u00a0 \\u00a025 \\u20ac<br \\/><\\/span><span style=\\\"font-size: 18px;\\\">Logo 35\\u00a0<\\/span><span style=\\\"font-family: Poppins, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400;\\\">\\u20ac<\\/span><span style=\\\"font-size: 18px;\\\">\\u00a0<\\/span><\\/p><p><em>Uskoro kod nas : IZRADA WOOCOMMERCE WEB SHOPA\\u00a0<\\/em><\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Poppins\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18,\"sizes\":[]},\"_padding\":{\"unit\":\"px\",\"top\":\"30\",\"right\":\"30\",\"bottom\":\"30\",\"left\":\"30\",\"isLinked\":true},\"_background_background\":\"classic\",\"_background_color\":\"rgba(0,0,0,0.81)\",\"_border_border\":\"solid\",\"_border_width\":{\"unit\":\"px\",\"top\":\"3\",\"right\":\"3\",\"bottom\":\"3\",\"left\":\"3\",\"isLinked\":true},\"_border_color\":\"#ffffff\",\"_border_radius\":{\"unit\":\"px\",\"top\":\"10\",\"right\":\"10\",\"bottom\":\"10\",\"left\":\"10\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":true},{\"id\":\"efad832\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"521d995\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><br \\/>Odr\\u017eavanje sajta ne pla\\u0107ate prva tri meseca.<br \\/><span style=\\\"font-size: 18px;\\\"><br \\/>Potrebno je da nam po\\u0161aljete sadr\\u017eaj koji uklju\\u010duje fotografije, tekst i da odaberete Wordpress temu \\u0161to pre kako bismo br\\u017ee krenuli sa izradom sajta.<\\/span><\\/p><p>Sa radom kre\\u0107emo u \\u0161to kra\\u0107em roku nakon \\u0161to nam uplatite punu cenu paketa i cenu za domen i hosting.<br \\/>Kada uplatite imajte razumevanja da postoji mogu\\u0107nost da ne mo\\u017eemo odmah po\\u010deti sa izradom. U zavisnosti od trenutnog posla sa izradom \\u0107emo krenuti u narednih nekoliko dana.<br \\/><br \\/><\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Poppins\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18,\"sizes\":[]},\"_padding\":{\"unit\":\"px\",\"top\":\"30\",\"right\":\"30\",\"bottom\":\"30\",\"left\":\"30\",\"isLinked\":true},\"_background_background\":\"classic\",\"_background_color\":\"rgba(0,0,0,0.81)\",\"_border_border\":\"solid\",\"_border_width\":{\"unit\":\"px\",\"top\":\"3\",\"right\":\"3\",\"bottom\":\"3\",\"left\":\"3\",\"isLinked\":true},\"_border_color\":\"#ffffff\",\"_border_radius\":{\"unit\":\"px\",\"top\":\"10\",\"right\":\"10\",\"bottom\":\"10\",\"left\":\"10\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":true}],\"isInner\":true}],\"isInner\":false}],\"isInner\":false}]'),
