(1, 1, '2019-06-18 14:57:21', '2019-06-18 14:57:21', '<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2019-06-18 14:57:21', '2019-06-18 14:57:21', '', 0, 'http://localhost/webtribuo/?p=1', 0, 'post', '', 1),
(7, 1, '2019-06-18 16:01:12', '2019-06-18 16:01:12', '<a href=\"http://webtribuo.com\" data-elementor-open-lightbox=\"\">\n							<img width=\"1287\" height=\"368\" src=\"http://localhost/webtribuo/wp-content/uploads/2019/06/logowhitepng-1.png\" alt=\"\" srcset=\"http://localhost/webtribuo/wp-content/uploads/2019/06/logowhitepng-1.png 1287w, http://localhost/webtribuo/wp-content/uploads/2019/06/logowhitepng-1-300x86.png 300w, http://localhost/webtribuo/wp-content/uploads/2019/06/logowhitepng-1-768x220.png 768w, http://localhost/webtribuo/wp-content/uploads/2019/06/logowhitepng-1-1024x293.png 1024w\" sizes=\"(max-width: 1287px) 100vw, 1287px\" />								</a>\n			<h4>Ako te nema na internetu – ne postojiš. </h4>		\n		<p> U današnje vreme je postalo nezamislivo da niste u mogućnosti da pronađete željene informacije o firmama, kompanijama ili brendovima, zato nemojte da čekate napravite web sajt i dajte svom biznisu novi život na internetu.</p><p>Ukoliko želite da pružite informacije o sebi, svom biznisu ili jednostavno samo želite svoj blog javite nam se .</p>		\n			<a href=\"webtribuo/kontakt\" role=\"button\">\n						KONTAKTIRAJTE NAS\n					</a>\n			<h5>Moderno.</h5>		\n			<h5>Elegantno.</h5>		\n			<h5>Urbano.</h5>		\n			<h1>Šta radimo?</h1>		\n		<p>Izrađujemo wordpress sajtove po vašoj želji<br />Šta je wordpress? </p>		\n		<p>WordPress je jedna od najmoćnijih i najjednostavnijih platformi za&nbsp; izradu sajtova i blogova. To omogućava mnogo bržu i lepšu izradu web sajta nego na klasičan način.&nbsp;Neki od svetski poznatih kompanija koje koriste wordpress su: SONY, PlayStation, BBC America, Nike, Sony Music,&nbsp;MTV News, Beyonce, Oficijalni sajt Švedske, Apple, Usain Bolt, i mnogi drugi</p>\n<p>Svaki web sajt koji napravimo je u potpunosti responsive, odnosno izgled sajta je savršen na svim uređajima kao što su desktop računari, tableti ili mobilni uređaji. Klikom na dugme ispod pogledajte neke od naših radova.</p><p>U našoj ponudi možete da pronađete i izradu jednostavnih logo-a.</p>		\n			<a href=\"webtribuo/radovi\" role=\"button\">\n						NAŠI RADOVI\n					</a>\n			<h3>Brza izrada web sajtova i blogova</h3>		\n		<p>Veoma brza izrada vašeg web sajta ili bloga uz veoma povoljne cene. Klikom na dugme ispod pogledajte naš cenovnik i šta mi nudimo. </p>		\n			<a href=\"webtribuo/cenovnik\" role=\"button\">\n						CENOVNIK\n					</a>', 'Početna stranica', '', 'publish', 'closed', 'closed', '', 'pocetna-stranica', '', '', '2019-06-21 22:21:04', '2019-06-21 22:21:04', '', 0, 'http://localhost/webtribuo/?page_id=7', 0, 'page', '', 0),
