(9, 1, '2019-06-18 16:02:38', '2019-06-18 16:02:38', '<h2>Ukoliko želite da sarađujete sa nama ili imate bilo kakva pitanja slobodno nam pišite :</h2>		\n			<h2>webtribuo@gmail.com</h2>		\n							<a href=\"https://www.instagram.com/webtribuo/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Instagram\n				</a>\n							<a href=\"https://www.youtube.com/channel/UC4RFdDadVYr1P3B-6Uiyl5w\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Youtube\n				</a>\n		[contact-form-7 id=\"150\" title=\"Contact form 1\"]', 'Kontakt', '', 'publish', 'closed', 'closed', '', 'kontakt', '', '', '2019-06-23 17:18:11', '2019-06-23 17:18:11', '', 0, 'http://localhost/webtribuo/?page_id=9', 0, 'page', '', 0),
