(121, 1, '2019-06-19 13:21:32', '2019-06-19 13:21:32', '<h2>Restoran ljute hrane</h2>		\n		<p>Prikaz kako bi jedan restoran mogao da ima primamljivu stranicu za ovakvu vrstu hrane. Prosto da vam voda krene na usta.</p>https://www.youtube.com/watch?v=L3PFdd416FY		\n		https://www.youtube.com/watch?v=JmfEHd-73sc		\n			<h2>Turistička agencija</h2>		\n		<p>Svi volimo dobar odmor i lepe destinacije, ovo je jedna od ideja kako bi Vaš web sajt mogao da izgleda.&nbsp;</p>		\n			<h2>Blog</h2>		\n		<p>Napravite svoj blog i prikažite segmente svog života ili podelite svoja razmišljanja. Ovako i Vaš blog može da izgleda.</p>https://www.youtube.com/watch?time_continue=1&#038;v=ZEGeovMCdIo		\n			<figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"b0ca773\" href=\'http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_0WHuM7.png\'><img width=\"300\" height=\"231\" src=\"http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_0WHuM7-300x231.png\" alt=\"\" srcset=\"http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_0WHuM7-300x231.png 300w, http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_0WHuM7.png 400w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a>\n			</figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"b0ca773\" href=\'http://localhost/webtribuo/wp-content/uploads/2019/06/LOGO-CRNI.png\'><img width=\"300\" height=\"197\" src=\"http://localhost/webtribuo/wp-content/uploads/2019/06/LOGO-CRNI-300x197.png\" alt=\"\" srcset=\"http://localhost/webtribuo/wp-content/uploads/2019/06/LOGO-CRNI-300x197.png 300w, http://localhost/webtribuo/wp-content/uploads/2019/06/LOGO-CRNI.png 400w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a>\n			</figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"b0ca773\" href=\'http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_3xb90e-1.png\'><img width=\"300\" height=\"263\" src=\"http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_3xb90e-1-300x263.png\" alt=\"\" srcset=\"http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_3xb90e-1-300x263.png 300w, http://localhost/webtribuo/wp-content/uploads/2019/06/LogoMakr_3xb90e-1.png 400w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a>\n			</figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"b0ca773\" href=\'http://localhost/webtribuo/wp-content/uploads/2019/06/catlogoblack.png\'><img width=\"300\" height=\"296\" src=\"http://localhost/webtribuo/wp-content/uploads/2019/06/catlogoblack-300x296.png\" alt=\"\" srcset=\"http://localhost/webtribuo/wp-content/uploads/2019/06/catlogoblack-300x296.png 300w, http://localhost/webtribuo/wp-content/uploads/2019/06/catlogoblack.png 600w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a>\n			</figure>\n		<p>Nemate svoj logo? Znate li da je to veoma bitna stavka na svakoj stranici? Obratite se nama i izradićemo ga za vas.</p>', 'Radovi', '', 'publish', 'closed', 'closed', '', 'radovi', '', '', '2019-06-23 16:32:46', '2019-06-23 16:32:46', '', 0, 'http://localhost/webtribuo/?page_id=121', 0, 'page', '', 0),
