(137, 1, '2019-06-19 14:56:14', '2019-06-19 14:56:14', '<h2>Cenovnik</h2>		\n		<p>U okviru ovog paketa dobijate responsive statički web sajt u wordpressu do 3 stranice. Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>\n<p>Ovaj paket preporučujemo ukoliko ne postoji potreba za čestim ažuriranjem (izmenama) sadržaja, kao i u slučajevima kada nije potrebna interakcija sa posetiocima, već samo pružanje informacija o vama ili vašem biznisu.</p>\n<p></p>		\n			<h2>Junior paket<br>70 €</h2>		\n			<h2>Medior paket<br>199 €</h2>		\n		<p>U okviru ovog paketa dobijate responsive web sajt u WordPress-u, do 6 strana i jednu galerija slika (najviše 20 slika).<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />Google mapa i kontakt forma.<br />Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>		\n		<p>Izrada kompletnog responsive blog sajta.<br />Povezivanje sa društvenim mrežama.<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />Do 5 strana.</p>		\n			<h2>Bloger paket<br>150 €</h2>		\n		<p>VAŽNE INFORMACIJE</p><p>Svaki sajt <i>MORA </i>da poseduje hosting i domen koji se plaćaju, a njihova cena varira u odnosu na koliki vremenski period želite da ih obnavljate, u dogovoru sa vama biramo ono što Vama najviše odgovara.<br /><br />Ukoliko želite google analytics u okviru junior paketa to se naplaćuje dodatnih  15 €<br />Sat vremena vanrednog rada  5 €<br />Za svaku dodatnu stranicu naplaćujemo 7 €<br />Za svaku dodatnu galeriju slika naplaćujemo 7 € (do 20 slika)<br />Održavanje na polugodišnjem nivou (ažuriranje sajta i raznih plugina)   25 €<br />Logo 35 € </p><p><em>Uskoro kod nas : IZRADA WOOCOMMERCE WEB SHOPA <br /></em></p><p><br />Održavanje sajta ne plaćate prva tri meseca.<br /><br />Potrebno je da nam pošaljete sadržaj koji uključuje fotografije, tekst i da odaberete Wordpress temu što pre kako bismo brže krenuli sa izradom sajta.</p><p>Sa radom krećemo u što kraćem roku nakon što nam uplatite punu cenu paketa i cenu za domen i hosting.<br /><br />Kada uplatite imajte razumevanja da postoji mogućnost da ne možemo odmah početi sa izradom. U zavisnosti od trenutnog posla sa izradom ćemo krenuti u narednih nekoliko dana.<br /><br /></p>', 'Cenovnik', '', 'publish', 'closed', 'closed', '', 'cenovnik', '', '', '2019-06-24 22:59:06', '2019-06-24 22:59:06', '', 0, 'http://localhost/webtribuo/?page_id=137', 0, 'page', '', 0),
