(222, 1, '2019-06-20 14:03:15', '2019-06-20 14:03:15', '<h2>Cenovnik</h2>		\n		<p>U okviru ovog paketa dobijate responsive statički web sajt u wordpressu do 3 stranice. Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>\n<p>Ovaj paket preporučujemo ukoliko ne postoji potreba za čestim ažuriranjem (izmenama) sadržaja, kao i u slučajevima kada nije potrebna interakcija sa posetiocima, već samo pružanje informacija o vama ili vašem biznisu.</p>\n<p></p>		\n			<h2>Junior paket<br>70 €</h2>		\n			<h2>Medior paket<br>199 €</h2>		\n		<p>U okviru ovog paketa dobijate responsive web sajt u WordPress-u, do 6 strana i jednu galerija slika (najviše 20 slika).<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />On page SEO. <br />Gugl mapa i kontakt forma<br />Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>		\n		<p>Izrada kompletnog blog sajta</p>		\n			<h2>Bloger paket</h2>		\n			<h2>150 €</h2>', 'Cenovnik', '', 'inherit', 'closed', 'closed', '', '137-revision-v1', '', '', '2019-06-20 14:03:15', '2019-06-20 14:03:15', '', 137, 'http://localhost/webtribuo/137-revision-v1/', 0, 'revision', '', 0),
