(250, 1, '2019-06-23 17:36:09', '2019-06-23 17:36:09', '<h2>Cenovnik</h2>		\n		<p>U okviru ovog paketa dobijate responsive statički web sajt u wordpressu do 3 stranice. Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>\n<p>Ovaj paket preporučujemo ukoliko ne postoji potreba za čestim ažuriranjem (izmenama) sadržaja, kao i u slučajevima kada nije potrebna interakcija sa posetiocima, već samo pružanje informacija o vama ili vašem biznisu.</p>\n<p></p>		\n			<h2>Junior paket<br>70 €</h2>		\n			<h2>Medior paket<br>199 €</h2>		\n		<p>U okviru ovog paketa dobijate responsive web sajt u WordPress-u, do 6 strana i jednu galerija slika (najviše 20 slika).<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />Google mapa i kontakt forma.<br />Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>		\n		<p>Izrada kompletnog responsive blog sajta.<br />Povezivanje sa društvenim mrežama.<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />Dogovaranje oko željenih stranica.</p>		\n			<h2>Bloger paket<br>150 €</h2>		\n		<p>Ukoliko želite google analytics u okviru junior paketa to se naplaćuje dodatnih  15 €<br />Sat vremena vanrednog rada - 5 €<br />Održavanje na polugodišnjem nivou (ažuriranje sajta i raznih plugina)  - 25 €<br />Logo - 35e</p><p><em>Uskoro kod nas : IZRADA WOOCOMMERCE WEB SHOPA </em></p>', 'Cenovnik', '', 'inherit', 'closed', 'closed', '', '137-revision-v1', '', '', '2019-06-23 17:36:09', '2019-06-23 17:36:09', '', 137, 'http://localhost/webtribuo/137-revision-v1/', 0, 'revision', '', 0),
(251, 1, '2019-06-23 17:42:20', '2019-06-23 17:42:20', '<h2>Cenovnik</h2>		\n		<p>U okviru ovog paketa dobijate responsive statički web sajt u wordpressu do 3 stranice. Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>\n<p>Ovaj paket preporučujemo ukoliko ne postoji potreba za čestim ažuriranjem (izmenama) sadržaja, kao i u slučajevima kada nije potrebna interakcija sa posetiocima, već samo pružanje informacija o vama ili vašem biznisu.</p>\n<p></p>		\n			<h2>Junior paket<br>70 €</h2>		\n			<h2>Medior paket<br>199 €</h2>		\n		<p>U okviru ovog paketa dobijate responsive web sajt u WordPress-u, do 6 strana i jednu galerija slika (najviše 20 slika).<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />On page SEO. <br />Google mapa i kontakt forma.<br />Povezivanje sa društvenim mrežama ukoliko je to potrebno.</p>		\n		<p>Izrada kompletnog responsive blog sajta.<br />Povezivanje sa društvenim mrežama.<br />Povezivanje Google analitik koda sa Vašim web sajtom, tako ćete pratiti posetu na Vašem web sajtu.<br />Do 5 strana.</p>		\n			<h2>Bloger paket<br>150 €</h2>		\n		<p>Ukoliko želite google analytics u okviru junior paketa to se naplaćuje dodatnih  15 €<br />Sat vremena vanrednog rada - 5 €<br />Održavanje na polugodišnjem nivou (ažuriranje sajta i raznih plugina)  - 25 €<br />Za svaku dodatnu stranicu se naplaćuje 7€<br />Za svaku dodatnu galeriju slika naplaćujemo 7€ (do 20 slika)<br />Logo - 35e</p><p><em>Uskoro kod nas : IZRADA WOOCOMMERCE WEB SHOPA </em></p>', 'Cenovnik', '', 'inherit', 'closed', 'closed', '', '137-revision-v1', '', '', '2019-06-23 17:42:20', '2019-06-23 17:42:20', '', 137, 'http://localhost/webtribuo/137-revision-v1/', 0, 'revision', '', 0),
